import React from 'react'


export default function BookList(props) {
    return(
        <div className='list'>
           {
               props.books.map((book, i) => {
                   return <BookCard 
                                image={i.imagelink}
                                title={i.volumeInfo.title}
                                subtitle={i.volumeInfo.subtitle}
                                date={i.volumeInfo.publishedDat}
                   
                   
                   />
                 })}
        </div>
    )
}


